import styled from "styled-components";

const SectionContainer = styled.section`
            background: #F2F2F2;
            border: 2px solid #0B7373;
            borderRadius: 16px;
            position: absolute;
            width: 1412px;
            height: 500px;
            left: 254px;
            top: 1176px;
`;

const Title1 = styled.h1`
            position: absolute;
            width: 235px;
            height: 56px;
            left: 588px;
            top: 32px;

            fontFamily:Roboto;
            fontStyle: normal;
            fontWeight: 700;
            fontSize: 32px;
            lineHeight: 56px;
            display: flex;
            alignItems: center;
            textAlign: center;

            color: #222222;
`;


export {SectionContainer, Title1};
